var app=angular.module("myApp",["ng"]);app.service("$Plus",function(){this.plus=function(b,a){return parseFloat(b)+parseFloat(a)}});app.service("$Print",["$interval",function(b){var a=null;this.start=function(){a=b(function(){console.log("hello")},500)};this.stop=function(){b.cancel(a)}}]);app.controller("myCtrl",["$scope","$Plus","$Print",function(a,b,c){a.plus=function(){a.result=b.plus(a.num1,a.num2)};a.start=function(){c.start()};a.stop=function(){c.stop()}}]);